            redis.print(`Reply: ${reply}`);
        }
    });
}

function displaySchoolValue(schoolName) {
    client.get(schoolName, (err, reply) => {
        if (err) {
            console.log(`Error getting value for ${schoolName}`);
        } else {
            console.log(reply);
        }
    });
}

